INSERT INTO player (id, profile_photo, nickname, firstName, lastName, birth, country_id, overview)
VALUES ('17', 'images/profile/adren.jpg', 'AdreN', 'Dauren', 'Kystaubayev', '1990-02-04', '115', 'Dauren "AdreN" Kystaubayev (born February 4, 1990) is a Kazakh professional Counter-Strike: Global Offensive player and former Counter-Strike 1.6 and Counter-Strike: Source player. He is currently playing for AVANGAR as an entry fragger. He currently lives in Kyiv with his girlfriend.');

INSERT INTO player (id, profile_photo, nickname, firstName, lastName, birth, country_id, overview)
VALUES ('18', 'images/profile/dastan.jpg', 'dastan', 'Dastan', 'Akbayev', '1993-08-05', '115', 'Dastan "dastan" Akbayev is a former professional Kazakh Counter-Strike: Global Offensive and Counter-Strike 1.6 player. Previously, he was known for his performances as an in-game leader for Tengri and zARLANS. He is currently the coach for AVANGAR.');

