INSERT INTO player (id, profile_photo, nickname, firstName, lastName, birth, country_id, overview)
VALUES ('20', 'images/profile/elige.jpg', 'EliGE', 'Jonathan', 'Jablonowski', '1997-06-16', '236', 'Jonathan "EliGE" Jablonowski (born July 16, 1997) is an American professional Counter-Strike: Global Offensive player of Polish descent, whose competitive background lies in StarCraft II.');

