INSERT INTO player (id, profile_photo, nickname, firstName, lastName, birth, country_id, overview)
VALUES ('22', 'images/profile/naf.jpg', 'NAF', 'Keith', 'Marković', '1997-11-27', '40', 'Keith "NAF" Markovic (born November 24, 1997) is a Canadian professional Counter-Strike: Global Offensive player who currently plays for Team Liquid.');

INSERT INTO player (id, profile_photo, nickname, firstName, lastName, birth, country_id, overview)
VALUES ('23', 'images/profile/stewie2k.jpg', 'Stewie2K', 'Jacky', 'Yip', '1998-01-07', '236', 'Jacky ''Jake'' "Stewie2K" Yip (born January 7, 1998) is an American professional Counter-Strike: Global Offensive player. He currently plays for Team Liquid. He is widely regarded as one of the best players in North America, despite having only played CS:GO since the summer of 2014. On January 11th 2016, Stewie2K joined Cloud9. Although the initial announcement that he would be joining Cloud9 was met with criticism from both professionals and the public, such as Thorin criticizing the decision, Stewie2K soon became known as one of the best players in Cloud9. After 2 years on the roster and a Major win under his belt, he decided to move on and join SK Gaming under the leadership of Brazilian Legend FalleN replacing TACO on their active lineup. After a period of 3 months, he was signed by MIBR along with the other players of SK Gaming. Following months of up-and-down results, Stewie2K returned to his North American roots and joined Team Liquid.');

INSERT INTO player (id, profile_photo, nickname, firstName, lastName, birth, country_id, overview)
VALUES ('24', 'images/profile/adreN.jpg', 'adreN', 'Eric', 'Hoag', '1990-04-26', '236', 'Eric "adreN" Hoag (born April 26, 1990) is an American Counter-Strike: Global Offensive and former Counter-Strike: Source player. adreN has prior experience as an in-game-leader and/or an AWPer for various top level teams, such as Team iBUYPOWER and Team Liquid, as well as in Counter-Strike: Source with Team Dynamic, which he played for at the beginning of Counter-Strike: Global Offensive for a short while. He is currently the coach of Team Liquid.');